INSERT INTO `shola_posts` VALUES (1,1,'2019-03-18 11:52:12','2019-03-18 11:52:12','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','publish','open','open','','hello-world','','','2019-03-18 11:52:12','2019-03-18 11:52:12','',0,'http://localhost/wordpress/?p=1',0,'post','',1),(2,1,'2019-03-18 11:52:12','2019-03-18 11:52:12','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost/wordpress/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','open','','sample-page','','','2019-03-18 11:52:12','2019-03-18 11:52:12','',0,'http://localhost/wordpress/?page_id=2',0,'page','',0),(3,1,'2019-03-18 11:52:12','2019-03-18 11:52:12','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Our website address is: http://localhost/wordpress.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What personal data we collect and why we collect it</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comments</h3><!-- /wp:heading --><!-- wp:paragraph --><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contact forms</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Embedded content from other websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Your contact information</h2><!-- /wp:heading --><!-- wp:heading --><h2>Additional information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>How we protect your data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What data breach procedures we have in place</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What third parties we receive data from</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What automated decision making and/or profiling we do with user data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Industry regulatory disclosure requirements</h3><!-- /wp:heading -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2019-03-18 11:52:12','2019-03-18 11:52:12','',0,'http://localhost/wordpress/?page_id=3',0,'page','',0),(4,1,'2019-03-18 11:52:18','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2019-03-18 11:52:18','0000-00-00 00:00:00','',0,'http://localhost/wordpress/?p=4',0,'post','',0),(5,1,'2019-03-18 17:03:17','2019-03-18 17:03:17','<!-- wp:paragraph -->\n<p>It was too obvious from the outset that the ODP and ADP coalatoin wont sustain so long. End of the day, they worked together against a common enemy TPLF. But deep down, these two organization represent two people with completely different hisotrical understanding, ideology, and a competing interest in stuffs like Addis ababa. So the coaliation was not a true one from the begining. It was just symbolic and a temporoary one for the moment or until they defeat their common enemy. So it was obvious that fall out would ensue.  Besides, the influence from the oromo activists is really high and too much too ignore for ODP. And these activists and their ideas have the support from of majority of Oromo people. The oromo nationalist believe the concept of Ethiopia is not inclusives, and dominated by a culture of one group. A group, they belive, had a historical and political advantage for several centuries. Despite Ethiopia being a home of several nations and nationalities, the majority of the ormo nationalist firmly believe, the country is not representative of this fact.  Rather, they say, due to the afoarmentioned advantages, the country is representation of a specific groups , namely the Amhara and Tigrai. These ideas are not new. They were popullar among the most influencial figures of the student movements of the 60 like walelgn Asmare. These oromo elites and organizations like OLF has all been working and instilling these retheros into their constituence for several decades. An entire new generation has been brought up with this ideology. So, no surprise that the idea is popular among the vast majority of their respective people. However, as much as the idea is popular among the oromo elites and people, in general, the idea is equally opposed and infamous among substational number of Ethiopians. So, these two extreme and polarized understandings of the country are the most influencing factor of the current polticial ambience of the country.  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>So here comes the prime Minister Abey Ahmed. Abey ahmed has enjoyed his fair share of public support and a celebrity status fan fare to the point that the phonemone is termed as abeymenia.  It wont be overstatement to regard him as one of the most popular political figure with a support from the four ends of the country, may be with exception of the Tegaru people. So, it is unprecedent acceptance from a country of people with seemingly irreconcilable historical understandings and political interests. Abiy didnt miss the chance to seize this public support and usher in reforms after reforms. He utilized his charisma appropriately. With all the fanfare and the reforms, the reform, even if with no defined road map, seems on the right path to a journey of democracy.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The ruling party EPRDF.  Even if, EPRDF, as it stands now, is a coalition of four political organizations, it is a fact that ODP and ADP are the major political influencers. As I understand it, OPD and ADP <g class=\"gr_ gr_86 gr-alert gr_gramm gr_inline_cards gr_run_anim Grammar multiReplace\" id=\"86\" data-gr-id=\"86\">has</g> the power and the capability to guide Ethiopia out of the current fragile state and cruise the country into a more stable one.  Nevertheless,  ODP as an organization should have seen the bigger picture than being influenced by the extremist and the desire to try to gain the support of the general public. They should have prioritized building a democratic country and should have never been troubled by the influence of the Oromo activists and the <g class=\"gr_ gr_110 gr-alert gr_spell gr_inline_cards gr_run_anim ContextualSpelling ins-del\" id=\"110\" data-gr-id=\"110\">feer</g> to lose their political support. These days, to gain a public support you should stance your self along with the popular idea of your constituent. The idea could be as extremely sensitive as the Addis Ababa case. So ODP is now trying to be the choice of the Oromo people, hence, they are aligning themselves with the popular idea. Considering, the demands of the Oromo people and activists, that means falling out with <g class=\"gr_ gr_166 gr-alert gr_gramm gr_inline_cards gr_run_anim Grammar only-ins replaceWithoutSep\" id=\"166\" data-gr-id=\"166\">rest</g> of Ethiopians. The <g class=\"gr_ gr_22 gr-alert gr_spell gr_inline_cards gr_run_anim ContextualSpelling ins-del multiReplace\" id=\"22\" data-gr-id=\"22\">onlyi</g> way forward is if <g class=\"gr_ gr_180 gr-alert gr_gramm gr_inline_cards gr_run_anim Grammar only-ins replaceWithoutSep\" id=\"180\" data-gr-id=\"180\">political</g> organization like ADP and NAMMA(ABN) are strong and in the position <g class=\"gr_ gr_181 gr-alert gr_spell gr_inline_cards gr_run_anim ContextualSpelling ins-del\" id=\"181\" data-gr-id=\"181\">counter balance</g> and dispel claims from the Oromo organizations and individuals.</p>\n<!-- /wp:paragraph -->','The coalation that never was','','publish','open','open','','new-post','','','2019-03-18 17:58:41','2019-03-18 17:58:41','',0,'http://localhost/wordpress/?p=5',0,'post','',0),(6,1,'2019-03-18 17:03:17','2019-03-18 17:03:17','<!-- wp:paragraph -->\n<p>it was too obvious from the outset that the ODP and ADP coalatoin wont sustain so long. End of the day, they worked together against a common enemy TPLF. But deep down, these two organization represent two people with completely different hisotrical understanding, ideology, and a competing interest in stuffs like Addis ababa. So the coaliation was not a true one from the begining. It was just symbolic and a temporoary one for the moment or until they defeat their common enemy. So it was obvious that fall out would ensue.  Besides, the influence from the oromo extremist is really high and too much too ignore for ODP. and these activists and their ideas have the support from of majority of Oromo people. These ideas are not new. These oromo activists and organizations like OLF has all been working and instilling these retheros for several decades. An entire new generation has been brought up with these ideology. So, no surprise that the idea is popular. ODP doesnt have the power and the support from the public to oppose the ideas. After all these ideas are popular among the vast majority of the people. Nevertheless,   ODP as organization should have seen the bigger picture than being influenced by the extremist and the desire to try to gain the support of the gneral public. They should have priotized building a democratic country and  should have never been troubled by the influence of the oromo activists and the feer to lose their political support. These days, to gain a public support you should stance your self along with the popular idea of your constituent. The idea could be as extremely sensitive as the Addis Ababa case. So ODP is now trying to be the choice of the oromo people, hence, they are aligning themselves with the popular idea. Considering, the demands of the oromo people and activists, that means falling out with rest of Ethiopians. The onlyi way forward is if political organziatino like ADP and NAMMA(ABN) are strong and in the position counter balance and dispel claims from the ormoo organazitions and individuals.</p>\n<!-- /wp:paragraph -->','New post','','inherit','closed','closed','','5-revision-v1','','','2019-03-18 17:03:17','2019-03-18 17:03:17','',5,'http://localhost/wordpress/2019/03/18/5-revision-v1/',0,'revision','',0),(7,1,'2019-03-18 17:11:19','2019-03-18 17:11:19','<!-- wp:paragraph -->\n<p>It was too obvious from the outset that the ODP and ADP coalatoin wont sustain so long. End of the day, they worked together against a common enemy TPLF. But deep down, these two organization represent two people with completely different hisotrical understanding, ideology, and a competing interest in stuffs like Addis ababa. So the coaliation was not a true one from the begini