el claims from the ormoo organazitions and individuals.</p>\n<!-- /wp:paragraph -->','New post','','inherit','closed','closed','','5-revision-v1','','','2019-03-18 17:11:19','2019-03-18 17:11:19','',5,'http://localhost/wordpress/2019/03/18/5-revision-v1/',0,'revision','',0),(8,1,'2019-03-18 17:14:20','2019-03-18 17:14:20','<!-- wp:paragraph -->\n<p>It was too obvious from the outset that the ODP and ADP coalatoin wont sustain so long. End of the day, they worked together against a common enemy TPLF. But deep down, these two organization represent two people with completely different hisotrical understanding, ideology, and a competing interest in stuffs like Addis ababa. So the coaliation was not a true one from the begining. It was just symbolic and a temporoary one for the moment or until they defeat their common enemy. So it was obvious that fall out would ensue.  Besides, the influence from the oromo activists is really high and too much too ignore for ODP. And these activists and their ideas have the support from of majority of Oromo people. The oromo nationalist believe the concept of Ethiopia is not inclusives, and dominated by a culture of one group. A group, they belive, had a historical and political advantage for several centuries. Despite Ethiopia being a home of several nations and nationalities, the majority of the ormo nationalist firmly believe, the country is not representative of this fact.  Rather, they say, due to the afoarmentioned advantages, the country is representation of a specific groups , namely the Amhara and Tigrai. These ideas are not new. They were popullar and supported by student movements of the 60. These oromo elites and organizations like OLF has all been working and instilling these retheros for several decades. An entire new generation has been brought up with knowing and learning this ideology. So, no surprise that the idea is popular. ODP doesnt have the power and the support from the public to oppose the ideas. After all these ideas are popular among the vast majority of the people. Nevertheless,   ODP as organization should have seen the bigger picture than being influenced by the extremist and the desire to try to gain the support of the gneral public. They should have priotized building a democratic country and  should have never been troubled by the influence of the oromo activists and the feer to lose their political support. These days, to gain a public support you should stance your self along with the popular idea of your constituent. The idea could be as extremely sensitive as the Addis Ababa case. So ODP is now trying to be the choice of the oromo people, hence, they are aligning themselves with the popular idea. Considering, the demands of the oromo people and activists, that means falling out with rest of Ethiopians. The onlyi way forward is if political organziatino like ADP and NAMMA(ABN) are strong and in the position counter balance and dispel claims from the ormoo organazitions and individuals.</p>\n<!-- /wp:paragraph -->','New post','','inherit','closed','closed','','5-revision-v1','','','2019-03-18 17:14:20','2019-03-18 17:14:20','',5,'http://localhost/wordpress/2019/03/18/5-revision-v1/',0,'revision','',0),(9,1,'2019-03-18 17:22:51','2019-03-18 17:22:51','<!-- wp:paragraph -->\n<p>It was too obvious from the outset that the ODP and ADP coalatoin wont sustain so long. End of the day, they worked together against a common enemy TPLF. But deep down, these two organization represent two people with completely different hisotrical understanding, ideology, and a competing interest in stuffs like Addis ababa. So the coaliation was not a true one from the begining. It was just symbolic and a temporoary one for the moment or until they defeat their common enemy. So it was obvious that fall out would ensue.  Besides, the influence from the oromo activists is really high and too much too ignore for ODP. And these activists and their ideas have the support from of majority of Oromo people. The oromo nationalist believe the concept of Ethiopia is not inclusives, and dominated by a culture of one group. A group, they belive, had a historical and political advantage for several centuries. Despite Ethiopia being a home of several nations and nationalities, the majority of the ormo nationalist firmly believe, the country is not representative of this fact.  Rather, they say, due to the afoarmentioned advantages, the country is representation of a specific groups , namely the Amhara and Tigrai. These ideas are not new. They were popullar and supported by student movements of the 60. These oromo elites and organizations like OLF has all been working and instilling these retheros for several decades. An entire new generation has been brought up with knowing and learning this ideology. So, no surprise that the idea is popular. ODP doesnt have the power and the support from the public to oppose the ideas. After all these ideas are popular among the vast majority of the people. However, as much as the idea is popular among the oromo elites and people, in general, the idea is equally opposed and infamous among the rest of Ethiopians. So, these two extreme and polarized understandings of the country are the most influencing factor of the current polticial ambience of the country.  So here comes the ruling party EPRDF. Even if, EPRDF, as it stands now, is a coalation of four political organizations, it is a fact that ODP and ADP are the major political playres of the game. As I understand it, OPD and ADP has the power and the capability to guide Ethiopia out of the current fragile state and curise the country into a more stable one.  Nevertheless,  ODP as organization should have seen the bigger picture than being influenced by the extremist and the desire to try to gain the support of the gneral public. They should have priotized building a democratic country and  should have never been troubled by the influence of the oromo activists and the feer to lose their political support. These days, to gain a public support you should stance your self along with the popular idea of your constituent. The idea could be as extremely sensitive as the Addis Ababa case. So ODP is now trying to be the choice of the oromo people, hence, they are aligning themselves with the popular idea. Considering, the demands of the oromo people and activists, that means falling out with rest of Ethiopians. The onlyi way forward is if political organziatino like ADP and NAMMA(ABN) are strong and in the position counter balance and dispel claims from the ormoo organazitions and individuals.</p>\n<!-- /wp:paragraph -->','New post','','inherit','closed','closed','','5-revision-v1','','','2019-03-18 17:22:51','2019-03-18 17:22:51','',5,'http://localhost/wordpress/2019/03/18/5-revision-v1/',0,'revision','',0),(10,1,'2019-03-18 17:26:10','2019-03-18 17:26:10','<!-- wp:paragraph -->\n<p>It was too obvious from the outset that the ODP and ADP coalatoin wont sustain so long. End of the day, they worked together against a common enemy TPLF. But deep down, these two organization represent two people with completely different hisotrical understanding, ideology, and a competing interest in stuffs like Addis ababa. So the coaliation was not a true one from the begining. It was just symbolic and a temporoary one for the moment or until they defeat their common enemy. So it was obvious that fall out would ensue.  Besides, the influence from the oromo activists is really high and too much too ignore for ODP. And these activists and their ideas have the support from of majority of Oromo people. The oromo nationalist believe the concept of Ethiopia is not inclusives, and dominated by a culture of one group. A group, they belive, had a historical and political advantage for several centuries. Despite Ethiopia being a home of several nations and nationalities, the majority of the ormo nationalist firmly believe, the country is not representative of this fact.  Ra