rest of Ethiopians. The onlyi way forward is if political organziatino like ADP and NAMMA(ABN) are strong and in the position counter balance and dispel claims from the ormoo organazitions and individuals.</p>\n<!-- /wp:paragraph -->','The coalation that never was','','inherit','closed','closed','','5-revision-v1','','','2019-03-18 17:56:33','2019-03-18 17:56:33','',5,'http://localhost/wordpress/2019/03/18/5-revision-v1/',0,'revision','',0),(19,1,'2019-03-18 17:58:41','2019-03-18 17:58:41','<!-- wp:paragraph -->\n<p>It was too obvious from the outset that the ODP and ADP coalatoin wont sustain so long. End of the day, they worked together against a common enemy TPLF. But deep down, these two organization represent two people with completely different hisotrical understanding, ideology, and a competing interest in stuffs like Addis ababa. So the coaliation was not a true one from the begining. It was just symbolic and a temporoary one for the moment or until they defeat their common enemy. So it was obvious that fall out would ensue.  Besides, the influence from the oromo activists is really high and too much too ignore for ODP. And these activists and their ideas have the support from of majority of Oromo people. The oromo nationalist believe the concept of Ethiopia is not inclusives, and dominated by a culture of one group. A group, they belive, had a historical and political advantage for several centuries. Despite Ethiopia being a home of several nations and nationalities, the majority of the ormo nationalist firmly believe, the country is not representative of this fact.  Rather, they say, due to the afoarmentioned advantages, the country is representation of a specific groups , namely the Amhara and Tigrai. These ideas are not new. They were popullar among the most influencial figures of the student movements of the 60 like walelgn Asmare. These oromo elites and organizations like OLF has all been working and instilling these retheros into their constituence for several decades. An entire new generation has been brought up with this ideology. So, no surprise that the idea is popular among the vast majority of their respective people. However, as much as the idea is popular among the oromo elites and people, in general, the idea is equally opposed and infamous among substational number of Ethiopians. So, these two extreme and polarized understandings of the country are the most influencing factor of the current polticial ambience of the country.  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>So here comes the prime Minister Abey Ahmed. Abey ahmed has enjoyed his fair share of public support and a celebrity status fan fare to the point that the phonemone is termed as abeymenia.  It wont be overstatement to regard him as one of the most popular political figure with a support from the four ends of the country, may be with exception of the Tegaru people. So, it is unprecedent acceptance from a country of people with seemingly irreconcilable historical understandings and political interests. Abiy didnt miss the chance to seize this public support and usher in reforms after reforms. He utilized his charisma appropriately. With all the fanfare and the reforms, the reform, even if with no defined road map, seems on the right path to a journey of democracy.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The ruling party EPRDF.  Even if, EPRDF, as it stands now, is a coalition of four political organizations, it is a fact that ODP and ADP are the major political influencers. As I understand it, OPD and ADP <g class=\"gr_ gr_86 gr-alert gr_gramm gr_inline_cards gr_run_anim Grammar multiReplace\" id=\"86\" data-gr-id=\"86\">has</g> the power and the capability to guide Ethiopia out of the current fragile state and cruise the country into a more stable one.  Nevertheless,  ODP as an organization should have seen the bigger picture than being influenced by the extremist and the desire to try to gain the support of the general public. They should have prioritized building a democratic country and should have never been troubled by the influence of the Oromo activists and the <g class=\"gr_ gr_110 gr-alert gr_spell gr_inline_cards gr_run_anim ContextualSpelling ins-del\" id=\"110\" data-gr-id=\"110\">feer</g> to lose their political support. These days, to gain a public support you should stance your self along with the popular idea of your constituent. The idea could be as extremely sensitive as the Addis Ababa case. So ODP is now trying to be the choice of the Oromo people, hence, they are aligning themselves with the popular idea. Considering, the demands of the Oromo people and activists, that means falling out with <g class=\"gr_ gr_166 gr-alert gr_gramm gr_inline_cards gr_run_anim Grammar only-ins replaceWithoutSep\" id=\"166\" data-gr-id=\"166\">rest</g> of Ethiopians. The <g class=\"gr_ gr_22 gr-alert gr_spell gr_inline_cards gr_run_anim ContextualSpelling ins-del multiReplace\" id=\"22\" data-gr-id=\"22\">onlyi</g> way forward is if <g class=\"gr_ gr_180 gr-alert gr_gramm gr_inline_cards gr_run_anim Grammar only-ins replaceWithoutSep\" id=\"180\" data-gr-id=\"180\">political</g> organization like ADP and NAMMA(ABN) are strong and in the position <g class=\"gr_ gr_181 gr-alert gr_spell gr_inline_cards gr_run_anim ContextualSpelling ins-del\" id=\"181\" data-gr-id=\"181\">counter balance</g> and dispel claims from the Oromo organizations and individuals.</p>\n<!-- /wp:paragraph -->','The coalation that never was','','inherit','closed','closed','','5-revision-v1','','','2019-03-18 17:58:41','2019-03-18 17:58:41','',5,'http://localhost/wordpress/2019/03/18/5-revision-v1/',0,'revision','',0);
